window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"version":"11.1.1","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.22631"},"runtime":{"name":"node.js","version":"22.12.0"}}},{"source":{"data":"@api1\r\nFeature: GoRest User Management APIs\r\n  As a tester, I want to validate the core operations of the Gorest user Management APIs\r\n  so that I can ensure it functions correctly for listing, creating, updating, and deleting users.\r\n\r\n  Background:\r\n    Given The API is initialized with the base URL\r\n    And   Authentication is performed with a valid access token\r\n\r\n  Scenario: Retrive the List of users via using \"List Users\" API\r\n    When  A Get Request is made to retrieve the list of users\r\n    Then  The system should respond with a 200 OK status\r\n    And   The response should contain a list of users\r\n\r\n  Scenario: Create a new user By Using the \"Create User\" API\r\n    Given The user details are:\r\n      | Name               | Gender | Email                        | Status |\r\n      | Tenali Ramakrishna | Male   | tenali.ramakrishna@abdce.com | Active |\r\n    When  A Post request is made to create a new user\r\n    Then  The system should respond with a 201 Created status\r\n    And   The response should include the following:\r\n      | Name               | Status |\r\n      | Tenali Ramakrishna | Active |\r\n    And   The user ID should be saved for future use\r\n    And   I save the user ID for later\r\n\r\n  Scenario: Update the user details By Using the \"Update User\" API\r\n   Given  The user details for update are\r\n      | Name              | Email                           | Status |\r\n      | Allasani Peddana  | allasani.peddana@1234.com | active |\r\n    When  A Patch request is made to update the user with the saved ID\r\n    Then  The system should respond with 200 OK status\r\n    And   The response should include the following details:\r\n      | Name             | Email                           | Status |\r\n      | Allasani Peddana | allasani.peddana@1234.com | active |\r\n    And   The user ID should remain the same\r\n    And   The updated user details should be reflected\r\n\r\n  Scenario Outline: Delete the user via \"Delete User\" API\r\n    When  A Delete request is made to delete the user with the saved ID\r\n    Then  The system should respond with a 204 No Content status\r\n     And  The user should no longer exist in the system\r\n\r\n  Scenario: Create a new user with an invalid access token\r\n    Given Authenticating is with a Invalid access token\r\n    When  A Post Request is made to to Create an new user with Invalid token\r\n    Then  The system should respond with a 401 Unauthorized status\r\n    And   The response should include an error message indicating \"Invalid token\" with invalid token\r\n\r\n  Scenario: Create a new user with an Empty access token\r\n    Given Authenticating is with a empty access token\r\n    When  A Post Request is made to to Create an new user with empty token\r\n    Then  The system should respond with a 401 Unauthorized status\r\n    And   The response should include an error message indicating \"Authentication failed\" with empty token\r\n\r\n  Scenario: Retrieve the list of users with an invalid endpoint\r\n    When  A GET request is made to an invalid endpoint \"\/users-invalid\"\r\n    Then  The system should respond with a 404 Not Found status with invalid endpoint\r\n    And   The response should include an error message indicating \"Resource not found\"\r\n\r\n  Scenario: Update a user with an invalid user ID\r\n    Given The user details for update are\r\n      | Name              | Email                           | Status |\r\n      | Allasani Peddana  | allasani.peddana@1234.com       | Active |\r\n    When  A PATCH request is made to update the user with ID \"invalid-id\"\r\n    Then  The system should respond with a 404 Not Found status with invalid id\r\n    And   The user update api response should include an error message indicating \"Resource not found\" \r\n\r\n  Scenario: Delete a user with a non-existent user ID\r\n    When  A DELETE request is made to delete the user with ID \"\"\r\n    Then  The system should respond with a 404 Not Found status with empty id\r\n    And   The delete api response should include an error message\r\n\r\n  Scenario: Create a user with an invalid email format\r\n    Given The details for create user:\r\n      | Name               | Gender | Email            | Status |\r\n      | Tenali Ramakrishna | Male   | invalid-email.com| Active |\r\n    When  A POST request is made to create a new user with Invalid email format\r\n    Then  The system should respond with a 422 Unprocessable Entity status\r\n    And   The response should include an error message for the invalid email format\r\n  \r\n\r\n\r\n","uri":"tests\\features\\api\\gorest-user-api.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[{"location":{"line":1,"column":1},"name":"@api1","id":"744e5ff4-2883-431a-879f-402ee5e01c5c"}],"location":{"line":2,"column":1},"language":"en","keyword":"Feature","name":"GoRest User Management APIs","description":"  As a tester, I want to validate the core operations of the Gorest user Management APIs\n  so that I can ensure it functions correctly for listing, creating, updating, and deleting users.","children":[{"background":{"id":"2794916c-535a-4c15-9d70-83e23499ca51","location":{"line":6,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"12006625-ee94-45fd-8596-72e6f708d3f6","location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"The API is initialized with the base URL"},{"id":"ea3b45a9-891e-4147-b020-9aa36cb46122","location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"Authentication is performed with a valid access token"}]}},{"scenario":{"id":"5fd9e706-23 4fa6-a285-04ee47285712","text":"A POST request is made to create a new user with Invalid email format","type":"Action","astNodeIds":["d6b3110c-2bca-4f57-965c-b8de6253d167"]},{"id":"5792eca2-408e-4cf8-ab2e-f14d709648f8","text":"The system should respond with a 422 Unprocessable Entity status","type":"Outcome","astNodeIds":["3d6ec3c7-25a4-4b26-950e-1f0f908e634e"]},{"id":"b955c941-d579-4343-be9b-e4a7dfd46865","text":"The response should include an error message for the invalid email format","type":"Outcome","astNodeIds":["6d2aa3d7-07ce-42e5-befd-5eaadecce2bc"]}]}},{"source":{"data":"@api2\r\nFeature: Groceries API Test Suite\r\n   To verify the functionality of the Groceries API,\r\n   Including Token Generation, Product Management, Cart, and Order Operations.\r\n\r\n   Background:\r\n      Given  The Grocery baseURL is initialized\r\n\r\n   Scenario: Check if the server is up and running via API\r\n      When   I send a GET request to the endpoint \"\/status\".\r\n      Then   The response status code should be 200.\r\n      And    The response body should have \"status\" as \"UP\".\r\n\r\n   Scenario: Validate the Access token Generation API functionality\r\n      Given  I create a token for client \"TestClient\"\r\n      When   I send a POST request to \"\/api-clients\"\r\n      Then   I should receive a 201 status code\r\n      And    The response should contain \"accessToken\"\r\n\r\n   Scenario: Verify the API functionaliy to fetch a specific products by ID\r\n      Given  I send a GET request to the endpoint \"\/products\/4643\".\r\n      Then   The response status code should be 200.\r\n      And    The Featch Api response body should have 4643.\r\n\r\n   Scenario: Validate the API functionality to fetch the complete list of products.\r\n      Given  The Featch All Product API endpoint is \"\/products\"\r\n      When   I send a GET request to the Featching All produtcts\r\n      Then   The response status code should be 200.\r\n      And    The response body should contain a list of products.\r\n\r\n   Scenario: Access Token Generation with Invalid Client Name\r\n      Given  I create a token for client \" \"\r\n      When   I send a POST request to \"\/api-clients\"\r\n      Then   I should receive a 400 Bad Request status code\r\n      And    The response body should contain an error message indicating \"Invalid or missing client name.\"\r\n\r\n   Scenario: Fetching Product by Nonexistent ID\r\n      Given  I send a GET request to the NonExist Product ID endpoint \"\/products\/9999999\"\r\n      Then   The response status code should be 404 Not Found\r\n      And    The response body should contain an error message indicating \"No product with id 9999999.\" with NonExistentId Request\r\n\r\n   Scenario: Fetching Product with Invalid ID Format\r\n      Given  I send a GET request to the endpoint \"\/products\/abc123\".\r\n      Then   The response status code should be 400 Bad Request\r\n      And    The response body should contain an error message indicating \"The product id must be a number.\" with Invalid ID\r\n\r\n","uri":"tests\\features\\api\\grocery-apis.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[{"location":{"line":1,"column":1},"name":"@api2","id":"4cb1dbdf-1ed6-4432-8f3a-2c9d26f3198e"}],"location":{"line":2,"column":1},"language":"en","keyword":"Feature","name":"Groceries API Test Suite","description":"   To verify the functionality of the Groceries API,\n   Including Token Generation, Product Management, Cart, and Order Operations.","children":[{"background":{"id":"e2dec3d1-1839-4708-a70e-cd86997b4afd","location":{"line":6,"column":4},"keyword":"Background","name":"","description":"","steps":[{"id":"7b38513f-bf23-48b5-b268-5445bd2bd8be","location":{"line":7,"column":7},"keyword":"Given ","keywordType":"Context","text":"The Grocery baseURL is initialized"}]}},{"scenario":{"id":"041f6823-1b46-4184-9578-b72e950e88af","tags":[],"location":{"line":9,"column":4}," \r\n     And I accept cookies from the homepage\r\n     And I click on \"Shopping tools\" from the homepage\r\n     And I select the \"Available cars\" option.\r\n\r\n Scenario Outline: Verify 'Sort By' filters functionality\r\n     When I enter zip code and select an address from the suggestions\r\n      And I should continue with the selected Retailer address\r\n     Then I verify the default sort \"Quickest delivery\" filter applied\r\n      And I Apply Price \"<SortFilter>\" Filter the Cars Display should be \"<DisplayOrder>\" Sorted order \r\n   Examples:\r\n      | SortFilter      | DisplayOrder  |\r\n      | High to low     | descending    |\r\n      | Low to high     | ascending     |\r\n\r\n Scenario Outline: Verify Car Filters with Various Combinations of Selections\r\n     When I enter zip code and select an address from the suggestions\r\n      And I should continue with the selected Retailer address\r\n     When I apply the following filters from car selection page : \r\n       | Exterior    | Version    | Packs      | Options    | Interior    | Wheels     |\r\n       | <Exterior>  | <Version>  | <Packs>    | <Options>  | <Interior>  | <Wheels>   |\r\n     And I Click on the results button  \r\n    Then I should see cars that match the selected filters:\r\n       | Exterior    | Version    | Packs      | Options    | Interior    | Wheels     |\r\n       | <Exterior>  | <Version>  | <Packs>    | <Options>  | <Interior>  | <Wheels>   |\r\n    Examples:\r\n    # Case 1: Select all options for exterior, version, packs, options, interior, and wheels\r\n       | Exterior  | Version               | Packs       | Options                     | Interior                | Wheels           |\r\n       | Snow      | Long range Dual motor | Performance | Harman Kardon premium sound | Charcoal Nappa leather  | 20\" Performance  |\r\n       | Storm     | Long range Dual motor | Performance | Harman Kardon premium sound | Charcoal WeaveTech      | 20\" Performance  |\r\n    # Case 2: Select only a few options from each category (some are left blank or not selected)\r\n       |           | Long range Dual motor | Performance | Harman Kardon premium sound | Charcoal Nappa leather  | 20\" Performance  |\r\n       | Space     |                       |             | Harman Kardon premium sound | Zinc Nappa leather      | 20\" Performance  |\r\n       | Midnight  | Long range Dual motor | Climate     |                             | Slate WeaveTech         | 20\" Performance  |\r\n    # Case 3: Select some options from only specific categories (more selective filtering)\r\n       | Snow      |                       | Performance |                             | Charcoal Nappa leather  | 20\" Performance  |\r\n       | Vapour    |                       | Pilot       | Harman Kardon premium sound | Zinc Nappa leather      |                  |\r\n    # Case 4: Test all versions with specific interior and wheels combination\r\n       | Snow      | Long range Dual motor | Performance |                              | Charcoal Nappa leather |                  |\r\n       | Midnight  |                       | Performance |                              | Slate WeaveTech        | 20\" Performance  |\r\n\r\n Scenario: Verify Default Filters for Car Details by Pin Code and Address\r\n     When I enter zip code and select an address from the suggestions\r\n     Then I should continue with the selected Retailer address\r\n      And I verify the default \"Polestar 2\" car model displayed in filter\r\n      And I see car Modelyear, Powertrain, and prices in dollars\r\n \r\n Scenario: Viewing More Car Options with Details by clicking show more\r\n     When I enter zip code and select an address from the suggestions\r\n      And I should continue with the selected Retailer address\r\n      And I click on the \"Show more\" button\r\n     Then I should see more car options with Modelyear, Powertrain, and price details\r\n","uri":"tests\\features\\web\\availab
